import React from "react";
import {Link} from 'react-router-dom';
import SearchBar from "./SearchBar";
import styles from "./modules.css/SearchBar.module.css";


const Nav = ({onSearch}) => {
    return (
        <div>         
             {/* About */}
             <nav className={styles.Navegador}>
            <SearchBar onSearch={onSearch}/>
             <Link to='/about'><button className={styles.button}>About</button></Link>
             <Link to='/home'><button className={styles.button}>Home</button></Link>
             <Link to='/favorites'><button>Favorites</button></Link>
      
        </nav>
        </div>

    )
}

export default Nav;
